import { useState, useEffect } from 'react';
import '../stylesheets/App.css';



import Signup from './Signup';

function App() {
  const [user, setUser] = useState(null)

  if (!user){
    return <Signup setUser={setUser} />
  }

  return
    <div>
      This will be where the homepage goes!
    </div>
}

export default App;
